const Job = (props) => {
  return (
    <div className="div-center">
      <div className="job-container">
        {' '}
        <span>
          <strong> Position: </strong>{' '}
        </span>{' '}
        {props.function}
      </div>
      <div>
        {' '}
        <span>
          {' '}
          <strong> Company: </strong>{' '}
        </span>{' '}
        {props.company}{' '}
      </div>{' '}
      <div>
        {' '}
        <span>
          {' '}
          <strong> Started: </strong>{' '}
        </span>{' '}
        {props.started}{' '}
      </div>
      <div>
        {' '}
        <span>
          {' '}
          <strong> Finished: </strong>{' '}
        </span>{' '}
        {props.finished}{' '}
      </div>{' '}
    </div>
  );
};

export default Job;
